import React from "react";
import styled from "styled-components";

const Contacts = () => {

    return (
        <ContactsContainer>
            <Iphone>
                <IphoneHeader>
                    <div>9:44</div>
                </IphoneHeader>
            </Iphone>
        </ContactsContainer>
    )
}

const ContactsContainer = styled.div`
    width: 80%;
    height: 100vh;
    margin: 90px auto;
    text-align: center;
    align-items: center;
`

const Iphone = styled.div`
    width: 437px;
    height: 882px;
    margin: 0px auto;
    background-image: url(/iPhoneImage/iPhoneImage.svg);
`

const IphoneHeader = styled.div`
    width: 90%;
    margin-top: 20px
`

export default Contacts;
